import {useSelector} from 'react-redux';

const Cart = () => {

  const {cart} = useSelector((state) => state);
  return (
    <div>
      {
        cart.length > 0 ? 
        (<div>
          <div>
            {
              cart.map((item, index) => {
                return <CartItem key={item.id} index={index} item={item} />
              })
          }
          </div>
        </div>
        ) : 
        (<div>
          <h1>Cart is empty</h1>
          <NavLink to="/"> <button>Shop Now</button></NavLink>
        </div>
        )
      }
    </div>
  )
};

export default Cart;
